import React, { Component, Fragment } from 'react';
import TodoItem from './TodoItem';
import './style.css';
import './css/bootstrap.min.css';
import './css/style.css';
import './css/responsive.css';
import './css/orange.css';

class TodoList extends Component {

	constructor(props) {
		super(props);
		}

render() {
	return(
      <div>
        <div id="top-bar" className="tb-text-white">
          <div className="container">
            <div className="row">          
              <div className="col-xs-12 col-sm-6 col-md-6 col-lg-6">
                <div id="info">
                  <ul className="list-unstyled list-inline">
                    <li><span><i className="fa fa-map-marker" /></span>Title</li>
                  </ul>
                </div>{/* end info */}
              </div>{/* end columns */}

              <div className="col-xs-12 col-sm-6 col-md-6 col-lg-6">
                <div id="links">
                  <ul className="list-unstyled list-inline">
                    <li><a href="login.html"><span><i className="fa fa-lock" /></span>Login</a></li>
                    <li><a href="registration.html"><span><i className="fa fa-plus" /></span>Sign Up</a></li>
                  </ul>
                </div>{/* end links */}
              </div>{/* end columns */}				
            </div>{/* end row */}
          </div>{/* end container */}
        </div>{/* end top-bar */}



        <section id="testimonials" className="section-padding back-size">
          <div className="container">
            <div className="row">
              <div className="col-sm-12">
                <div className="page-heading white-heading">
                  <h2>Testimonials</h2>
                  <hr className="heading-line" />
                </div>{/* end page-heading */}
                <div className="carousel slide" data-ride="carousel" id="quote-carousel">
                  <div className="carousel-inner text-center">
                    <div className="item active">
                      <blockquote>Lorem ipsum dolor sit amet, ad duo fugit aeque fabulas, in lucilius prodesset pri. Veniam delectus ei vis. Est atqui timeam mnesarchum at, pro an eros perpetua ullamcorper Lorem ipsum dolor sit amet, ad duo fugit aeque fabulas, in lucilius prodesset pri. Veniam delectus ei vis. Est atqui timeam mnesarchum at, pro an eros perpetua ullamcorper.</blockquote>
                      <div className="rating">
                        <span><i className="fa fa-star orange" /></span>
                        <span><i className="fa fa-star orange" /></span>
                        <span><i className="fa fa-star orange" /></span>
                        <span><i className="fa fa-star orange" /></span>
                        <span><i className="fa fa-star lightgrey" /></span>
                      </div>{/* end rating */}
                      <small>Jhon Smith</small>
                    </div>{/* end item */}
                    <div className="item">
                      <blockquote>Lorem ipsum dolor sit amet, ad duo fugit aeque fabulas, in lucilius prodesset pri. Veniam delectus ei vis. Est atqui timeam mnesarchum at, pro an eros perpetua ullamcorper Lorem ipsum dolor sit amet, ad duo fugit aeque fabulas, in lucilius prodesset pri. Veniam delectus ei vis. Est atqui timeam mnesarchum at, pro an eros perpetua ullamcorper.</blockquote>
                      <div className="rating">
                        <span><i className="fa fa-star orange" /></span>
                        <span><i className="fa fa-star orange" /></span>
                        <span><i className="fa fa-star orange" /></span>
                        <span><i className="fa fa-star orange" /></span>
                        <span><i className="fa fa-star lightgrey" /></span>
                      </div>{/* end rating */}
                      <small>Jhon Smith</small>
                    </div>{/* end item */}
                    <div className="item">
                      <blockquote>Lorem ipsum dolor sit amet, ad duo fugit aeque fabulas, in lucilius prodesset pri. Veniam delectus ei vis. Est atqui timeam mnesarchum at, pro an eros perpetua ullamcorper Lorem ipsum dolor sit amet, ad duo fugit aeque fabulas, in lucilius prodesset pri. Veniam delectus ei vis. Est atqui timeam mnesarchum at, pro an eros perpetua ullamcorper.</blockquote>
                      <div className="rating">
                        <span><i className="fa fa-star orange" /></span>
                        <span><i className="fa fa-star orange" /></span>
                        <span><i className="fa fa-star orange" /></span>
                        <span><i className="fa fa-star orange" /></span>
                        <span><i className="fa fa-star lightgrey" /></span>
                      </div>{/* end rating */}
                      <small>Jhon Smith</small>
                    </div>{/* end item */}
                  </div>{/* end carousel-inner */}
                  <ol className="carousel-indicators">
                    <li data-target="#quote-carousel" data-slide-to={0} className="active"><img src="images/client-1.jpg" className="img-responsive" alt="client-img" />
                    </li>
                    <li data-target="#quote-carousel" data-slide-to={1}><img src="images/client-2.jpg" className="img-responsive" alt="client-img" />
                    </li>
                    <li data-target="#quote-carousel" data-slide-to={2}><img src="images/client-3.jpg" className="img-responsive" alt="client-img" />
                    </li>
                  </ol>
                </div>{/* end quote-carousel */}
              </div>{/* end columns */}
            </div>{/* end row */}
          </div>{/* end container */}
        </section>{/* end testimonials */} 


      </div>
				)
}

}

export default TodoList;
